import './App.css';
import React from "react";
import {HashRouter,Routes,Route} from "react-router-dom";
import About from "./routes/About";

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/about" element={About} />
      </Routes>
    </HashRouter>
  );
}

export default App;
